import React from 'react';
import {Typography} from "@material-ui/core";
import makeStyles from "@material-ui/core/styles/makeStyles";

const useStyles = makeStyles({
    button : {
        marginTop : 20,
    }
});


const AskQuestion = (props) => {

const classes = useStyles();
    return (
        <div>
            <Typography>Ask a question</Typography>
            <form className="form">
                <input type="text" name="title" onChange={event => props.setArray({title: event.target.value})} />
                <input type="text" name="subtitle" onChange={event => props.setArray({subtitle : event.target.value})} />
                <input type="text" name="category" onChange={event => props.setArray({category : event.target.value})} />
                <button onClick={props.addQuestion}>Submit</button>
                <Typography component="p"></Typography>
            </form>
        </div>
    )
}

export default AskQuestion;
